<x-user.common.section class="bg-light py-14">
    <x-user.common.section-title title="OUR BRANDS" content="trademarks we are representing" />

    <style>
        html,
        body {
            position: relative;
            height: 100%;
        }

        body {
            background: #eee;
            font-family: Helvetica Neue, Helvetica, Arial, sans-serif;
            font-size: 14px;
            color: #000;
            margin: 0;
            padding: 0;
        }

        swiper-container {
            width: 100%;
            height: 100%;
            
        }

        .mySwiper {
            animation: infiniteScroll 100s infinite linear;
            display: flex;
            gap: 300px;
            margin-right: 300px;
        }

        .swiper__container:hover .mySwiper {
            animation-play-state: paused;
            position:relative;
        }

        .swiper__container {
            display: flex;
            overflow:hidden;
            position: relative;
            white-space: nowrap;
            padding: 10px 0;
        }

        .swiper__container::before {
            content: '';
            width: 200px;
            height: 100%;
            background: linear-gradient(to left, rgba(0, 0, 0, 0), white);
            position: absolute;
            top: 0;
            left: 0;
            z-index: 5;
        }

        .swiper__container::after {
            content: '';
            width: 200px;
            height: 100%;
            background: linear-gradient(to right, rgba(0, 0, 0, 0), white);
            position: absolute;
            top: 0;
            right: 0;
            z-index: 5;
        }
        
        @keyframes infiniteScroll {
            0% {
                transform: translate(0);
            }

            100% {
                transform: translate(-150%);
            }
        }

        div.mySwiper div {
            text-align: center;
            font-size: 18px;
            background: #fff;
            display: flex;
            justify-content: center;
            align-items: center;
            width: 100%;
            height: 100%;
        }

        div.mySwiper div img {
            display: block;
            width: 100%;
            height: 100%;
            object-fit: cover;
        }
    </style>

